import React, { useState } from 'react';
import EnvironmentSelectionPage from '../Container/EnvironmentSelectionPage';
import IPAddressForm from './IP_Whitelist.jsx'; // Importing the IPAddressForm component

function MainComponent() {
  const [environment_ip, setEnvironment] = useState(null);

  return (
    <div>
      {!environment_ip && <EnvironmentSelectionPage setEnvironment={setEnvironment} />}
      {environment_ip && <IPAddressForm environment={environment_ip} />} {/* Render IPAddressForm based on environment */}
    </div>
  );
}

export default MainComponent;
